Here are a few techniques I have learned about:

1. Constant Folding: This technique is used to optimize expressions that contain constants. The compiler replaces the expression with its evaluated value. For example, consider the following code:

```
int x = 2 + 3;
```

The compiler can optimize this expression by replacing it with `int x = 5;`.

2. Dead Code Elimination: This technique is used to remove code that is not used in the program. For example, consider the following code:

```
int x = 10;
int y = x + 1;
int z = y + 2;
```

The compiler can optimize this code by removing the unused variable `x`. The optimized code would look like this:

```
int y = 11;
int z = 13;
```

3. Common Subexpression Elimination: This technique is used to eliminate redundant computations. For example, consider the following code:

```
int x = a + b;
int y = a + b;
```

The compiler can optimize this code by eliminating the redundant computation of `a + b`. The optimized code would look like this:

```
int x = a + b;
int y = x;
```

4. Loop Optimization: This technique is used to optimize loops in the program. For example, consider the following code:

```
for (int i = 0; i < 1000000; i++) {
    int x = i * 2;
}
```

The compiler can optimize this code by unrolling the loop. The optimized code would look like this:

```
for (int i = 0; i < 1000000; i += 2) {
    int x = i * 2;
}
```

5. Function Inlining: This technique is used to replace a function call with the actual code of the function. For example, consider the following code:

```
int add(int a, int b) {
    return a + b;
}

